// This file contains the absolute addresses for each label in ROM. A macro creates the following:
// a{name} absolute address
// b{name} rom bank of the address
// m{name} address the function would appear as when loaded (0x0000-0x3FFF for home, 0x4000-0x7FFF for everything else)

#define FUNCMAP(x, y) 	static const uint32_t a##x = y;\
                        static const uint8_t b##x = (y >> 14);\
                        static const uint16_t m##x = (y < 0x4000 ? y : ((y & 0x3FFF) | 0x4000));

